import { useEffect, useState } from "react";
import "./style.css";
import { Link } from "react-router-dom";

function Navbar(){

    const [isSticky, setIsSticky] = useState(false);

    useEffect(() => {
        const handleScroll = () => {
          const nav = document.querySelector(".nav_bottom");
          nav.classList.toggle("sticky", window.scrollY > 100);
        };
    
        window.addEventListener("scroll", handleScroll);
    
        return () => {
          window.removeEventListener("scroll", handleScroll);
        };
      }, []);
    

    return(

        <div className={`nav_bottom ${isSticky ? "sticky" : ""}`}>    
        <div className="nav">
 <div className="nav_top">
                <div className="nav_top_container">
                    <div className="left">
                        <p>
                        AZERBAIJAN TRADE AND LOGISTICS GROUPÂ LLC
                             </p>
                           
                    </div>
                    <div className="right">
                    <div className="image">
                    <img src="image/logo.jpg" alt="" />
                    </div>
                    </div>
                </div>
            </div>
            <div className="nav_bottom">
                <div className="nav_bottom_container">
                    <nav>
                        <ul>
                            <li>
                               <Link to="/homes">Home</Link>
                                </li>
                            <li>
                            <Link to="/about">About</Link>
                            </li>
                            <li>
                                 <Link to="/contact">Contact</Link>
                                </li>
                        </ul>
                    </nav>
                    
                </div>
            </div>
        </div>
        </div>
       
    )
}

export default Navbar;
